import Note from "./Note";
import NoteCreator from "./NoteCreator";

const NotesList = ({notes, handleAddNote}) => {

  return (
    <div className="notes-list">
      {notes.map((note) => <Note id = {note.id} text = {note.text} date = {note.date} />)}
     <NoteCreator/>
    </div>
  );
};

export default NotesList;
